import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import bar from "./components/navbar.js"
import MyMixer from "./pages/MyMixer.js"
function App() {
  return (
    <><bar /><Router>
      <Routes>
        <Route path='/' exact component={MyMixer} />
      </Routes>
    </Router></>
  );
}

export default App;
